    <!-- Application Structure Plan: A single-page narrative SPA guiding the user from Problem -> Solution -> Value -> Action. The key interaction is a dynamic ROI calculator that allows the user to personalize the financial case, increasing engagement and credibility. This structure is more persuasive and user-friendly than a static document replica. -->
    <!-- Visualization & Content Choices: Challenges/Solutions presented in a comparative grid (HTML/CSS) for clarity. Financials are visualized with interactive Chart.js bar and donut charts linked to sliders, allowing user-driven exploration (Goal: Explore/Quantify). Pricing is a clear comparison table (HTML/CSS). Implementation is a visual timeline (HTML/CSS). This avoids static data presentation and promotes engagement. -->
    <!-- CONFIRMATION: NO SVG graphics used. NO Mermaid JS used. -->
    <style>
        :root {
            --brand-blue: #192A41;
        }
        body {
            font-family: 'Inter', sans-serif;
            background-color: #f8fafc;
            color: #1e293b;
        }
        .chart-container {
            position: relative;
            height: 320px;
            width: 100%;
            max-width: 500px;
            margin: auto;
        }
        @media (min-width: 768px) {
            .chart-container {
                height: 400px;
            }
        }
        .slider::-webkit-slider-thumb {
            -webkit-appearance: none;
            appearance: none;
            width: 20px;
            height: 20px;
            background: var(--brand-blue);
            cursor: pointer;
            border-radius: 50%;
        }
        .slider::-moz-range-thumb {
            width: 20px;
            height: 20px;
            background: var(--brand-blue);
            cursor: pointer;
            border-radius: 50%;
        }
        .kpi-card {
            background-color: white;
            border-radius: 0.75rem;
            padding: 1.5rem;
            box-shadow: 0 4px 6px -1px rgb(0 0 0 / 0.1), 0 2px 4px -2px rgb(0 0 0 / 0.1);
            transition: transform 0.2s ease-in-out, box-shadow 0.2s ease-in-out;
        }
        .kpi-card:hover {
            transform: translateY(-5px);
            box-shadow: 0 10px 15px -3px rgb(0 0 0 / 0.1), 0 4px 6px -4px rgb(0 0 0 / 0.1);
        }
        .text-brand-blue { color: var(--brand-blue); }
        .bg-brand-blue { background-color: var(--brand-blue); }
        .border-brand-blue { border-color: var(--brand-blue); }
        .hover\:text-brand-blue:hover { color: var(--brand-blue); }
        .hover\:bg-brand-blue-dark:hover { background-color: #111c2b; }
        .bg-brand-blue-light { background-color: #f0f3f6; }
    </style>
